import "./App.css";
import Sidebar from './SideBar';
import PostCall from "./PostCall";


function App() {

  return (
    <div className="app">

      <div className='app_header'>
        <img
          className='header_image'
          src="https://www.instagram.com/static/images/web/mobile_nav_type_logo.png/735145cfe0a4.png"
          alt=""
        />
      </div>
      <Sidebar />

      <PostCall />
    </div>
  );
}
export default App;
